function program()  load('data.txt');  %Минимальное значение  minimum = min(N)  %Максимальное значение  maximum = max(N)  %Размах  range = prange(N)  %Среднее арифмитическое  mean = pmean(N)  %Выборочная (эмпирическая) дисперсия  dispersion = var(N)  %Cтандартное (среднее квадратическое) отклонение  rms_diff = sqrt(dispersion) %Equal to std(N)  %Коэффициент вариации  variation_coeff = rms_diff/mean  %Оценка коэффициента асимметрии  skewness = skewness(N)  %Оценка эксцесса  kurtosis = kurtosis(N)  %Выборочная мода  mode = mode(N)  %Выборочная медиана  median = median(N)  %Save env as a file  save out.txtend%A custom function for the rangefunction res = prange (x)  x=sort(x(:));  n=length(x);  res = x(n)-x(1);end% A custom function for the mean valuefunction res = pmean(x)  n=length(x(:));  res = sum(vec(x))/n;end%Saves initial data as a file.function preconfigure ()  N = [35; 120; 144; 168; 48; 120; 72; 144; 96; 72; 72; 136; 120; 96; 192; 72; 72; 96; 72; 96; 72; 164; 72; 72; 168; 72; 96; 96; 48; 120; 72; 96; 72; 120; 72; 72]  save data.txt Nend